import "./topbar.css";

export const TopBar = () => {
    return (
        <div className="top">
            <div className="topLeft">
                <i class="fab fa-linkedin"></i>
                <i class="fab fa-github"></i>
                <i class="fab fa-instagram"></i>
                </div>
            <div className="topCenter">center</div>
            <div className="topRight">right</div>
        </div>
    )
}
